import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import not from "../../images/noti.png";
import "./profil.css";

const AppointmentDetails = () => {
  const [appointment, setAppointment] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

useEffect(() => {
  const fetchAppointments = async () => {
    try {
      const usrId = localStorage.getItem("uid");
      const token = localStorage.getItem("token");
      if (!usrId || !token) {
        setError("Missing token or user ID");
        setLoading(false);
        return;
      }

      const config = {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      };

      const response = await axios.get(
        `https://avocat-backend.onrender.com/api/appointment/user/${usrId}`,
        config
      );

      if (!Array.isArray(response.data)) {
        setError("Expected a list of appointments");
        setLoading(false);
        return;
      }

      setAppointment(response.data);
      setLoading(false);
    } catch (error) {
      console.error("Error fetching appointments", error);
      setError("Erreur lors de la récupération des rendez-vous");
      setLoading(false);
    }
  };

  fetchAppointments();
}, []);



  const handleDelete = async () => {
    try {
      const token = localStorage.getItem("token");
      if (!token) {
        setError("Token not found in local storage");
        return;
      }

      const Id = localStorage.getItem("tId");
      console.log("Appointment ID:", Id);
      if (!Id) {
        setError("Appointment ID not found in local storage");
        return;
      }

      const config = {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      };

      const response = await axios.delete(
        `https://avocat-backend.onrender.com/api/appointment/user/${Id}`,
        config
      );

      console.log("Appointment deleted successfully", response);
      alert("Appointment deleted successfully");
    } catch (error) {
      console.error(
        "Error deleting appointment:",
        error.response ? error.response.data : error.message
      );
      alert("Error deleting appointment. Please try again.");
    }
  };

  return (
    <div className="appcontainer">
      <div className="headerContainer">
        <h2>Mes Rendez-vous</h2>

        <Link to="/reminder">
          <img src={not} alt="reminder" className="profil" />
        </Link>
      </div>
      {loading ? (
        <div>Loading...</div>
      ) : appointments ? (
        <div className="appdatetime">
          <div>
            <b>Date: </b>
            {appointments.date
              ? new Date(appointment.date).toLocaleDateString()
              : "N/A"}
          </div>
          <div>
            {" "}
            <b>Heure:</b> {appointment.time}
          </div>
          <div>
            {" "}
            <b>Status:</b> {appointment.status}
          </div>
          {appointment.status === "denied" && (
            <div className="alert alert-danger">
              <b>Message:</b>
              {appointment.statusMessage}
            </div>
          )}
          {appointment.status === "confirmed" && (
            <div className="alert alert-success">
              <b>Paiement:</b> unvalid
            </div>
          )}
          <div className="op">
            <Link to="/EditAppointment">
              <button className="Folssa">Modifier</button>
            </Link>

            <Link to="/profile">
              <button className="Folssa" onClick={handleDelete}>
                Annuler
              </button>
            </Link>
          </div>
        </div>
      ) : (
        <div>Aucun détail sur les rendez-vous n'est disponible</div>
      )}
    </div>
  );
};

export default AppointmentDetails;
